import sys
from typing import List

def solve(n: int, a: List[List[int]]) -> int:
    for i in range(n):
        a[0][i] = int(input())
    for _ in range(1, n):
        for i in range(n):
            a[_][i] = a[0][(i+_)%n]
    for i in range(n):
        a[n][i] = a[0][n-1-i]
    for _ in range(1, n):
        for i in range(n):
            a[_+n][i] = a[n][(i+_)%n]
    ans = 1
    for _ in range(1, n+n):
        diff = True
        for __ in range(_):
            same = True
            for i in range(n):
                if a[_][i] != a[__][i]:
                    same = False
            if same:
                diff = False
        if diff:
            ans += 1
    return ans

n = int(input())
a = [[0] * 160 for _ in range(320)]
ans = solve(n, a)
print(ans)

